import Navigation from "../components/Navigation";

const Contact = () => {
  return (
    <>
      <Navigation />
      <div className="col-xl">
        <h1 className="profile display-4 fw-bolder">Contact</h1>

        <div>
          <ul className="list-group list-style-none">
            <li>Valence</li>
            <li>06.90.98.43.12</li>
            <li>Manuscrit974@gmail.com</li>
          </ul>
        </div>
      </div>
    </>
  );
};

export default Contact;
